import React from 'react';

function Footer(params) {
    return (
        <footer className="main-footer">
            <strong>Copyright &copy; 2021-<script> var CurrentYear = new Date().getFullYear() document.write(CurrentYear)
        </script> <a href="https://adminlte.io">Todrix</a>. </strong>
            All rights reserved.
            <div className="float-right d-none d-sm-inline-block">
            <b>Version</b> 3.1.0
            </div>
        </footer>
    )
}

export default Footer;
